import React from 'react';
import { Link } from 'react-router-dom';
import {
  Layout, Menu, Dropdown,
} from 'antd';
import { ShoppingOutlined, HomeOutlined ,ShopOutlined} from '@ant-design/icons';
import DropdownUser from '../dropdown-user/dropdown-user.component';
import CartDropDown from '../card-dropdown/card-dropdown.component';
import './navigation.styles.css';

const { Header } = Layout;
const Navigation = () => (
  <Header className="header" style={{ marginBottom: '20px' }}>
    <div className="logo" />
    <Menu
      style={{ float: 'right' }}
      theme="dark"
      mode="horizontal"
      defaultSelectedKeys={['1']}
    >
      <Menu.Item
        key="1"
        icon={(
          <Link to="/">
            <HomeOutlined style={{ fontSize: '25px', paddingTop: '10px' }} />
            Home
          </Link>
      )}
      >
        {' '}

      </Menu.Item>
      <Menu.Item
        icon={(
          <Link to="/checkout">
            <ShopOutlined
              style={{ fontSize: '25px', paddingTop: '10px' }}
            />
            Product
          </Link>
        )}
        key="2"
        style={{ marginRight: '0px' }}
      />
      <Menu.Item
        icon={(
          <Link to="/checkout">
            <ShoppingOutlined
              style={{ fontSize: '25px', paddingTop: '10px' }}
            />
            Cart
          </Link>
        )}
        key="3"
      />

      <Dropdown
        overlay={DropdownUser}
        overlayStyle={{ width: '200px' }}
        placement="topCenter"
      >
        <Link to="/user"> Thuong Le </Link>
      </Dropdown>
      <CartDropDown />
    </Menu>
  </Header>
);

export default Navigation;
